import { Morph } from "lively.morphic/morph.js";
import { h } from "lively.morphic/node_modules/virtual-dom/dist/virtual-dom.js";
import { defaultAttributes, defaultStyle } from "lively.morphic/rendering/morphic-default.js";
import TextTree from "lively.morphic/text2/document-tree.js";
import { addOrChangeCSSDeclaration } from "lively.morphic/rendering/dom-helper.js";
import { show, inspect } from "lively.morphic/index.js";
import { DOMMeasure, DOMTextMeasure } from "./measuring.js";
import { obj, num, arr } from "lively.lang/index.js";
import { pt } from "lively.graphics/index.js";

export default class AnotherText extends Morph {

  static get properties() {
    return {
      lineData: {},

      fontFamily: {defaultValue: "Georgia,Times,serif"},
      fontSize: {defaultValue: 14},
      fontColor: {defaultValue: "darkgray"},

      textScroll: {defaultValue: pt(0,0)},

      content: {
        derived: true, after: ["lineData"],
        get() {
          return this.lineData.lines.map(ea => ea.text).join("\n");
        },
        set(content) {
          let {lines} = this.lineData = new TextTree(content.split("\n"));
          this.estimateLineHeights(lines);
          this.makeDirty();
        }
      }
    }
  }

  reset() {
    let props = this.constructor.properties;
    let keys = Object.keys(props);
    keys.forEach(key =>
      typeof this[key] === "undefined" && (this[key] = props.defaultValue[key]))

    this.fontSize = 20;
    this.updateCSS();
    this.content = `This is line 1. And this is still line 1.
This is line 2.

This is line 4, line 4, line 4, still 4.
5
6
7
8
9`
  }

  updateCSS() {
    addOrChangeCSSDeclaration("new-text-css", `
      .newtext-scroller {
          -moz-box-sizing: content-box;
          box-sizing: content-box;
          overflow: auto !important;
          height: 100%;
          outline: none;
          position: relative;
      }

      .newtext-wrap .line>span {
        word-wrap: break-word;
        white-space: wrap;
        word-break: normal;
        word-break: break-all;
      }

      .newtext .line>span {
        -moz-border-radius: 0;
        -webkit-border-radius: 0;
        border-radius: 0;
        border-width: 0;
        background: transparent;
        font-family: inherit;
        font-size: inherit;
        margin: 0;
        word-wrap: normal;
        line-height: inherit;
        color: inherit;
        z-index: 2;
        position: relative;
        overflow: visible;
        -webkit-tap-highlight-color: transparent;
        -webkit-font-variant-ligatures: contextual;
        font-variant-ligatures: contextual;
      }
    `);
  }

  renderTextStuff(renderer) {
    let {
      height: scrollHeight,
      lineData: {lines},
      textScroll: {x: scrollLeft, y: scrollTop}
    } = this;

    let scrollBottom = scrollTop + scrollHeight,
        textHeight = 0,
        y = 0,
        row = 0,
        firstVisibleRow = 0,
        lastVisibleRow = 0;

    for (; row < lines.length; row++) {
      let lineHeight = lines[row].height;
      if (y + lineHeight > scrollTop) { firstVisibleRow = row; break; }
      y += lineHeight;
    }

    for (; row < lines.length; row++) {
      if (y > scrollBottom) { lastVisibleRow = row; break; }
      y += lines[row].height;
    }

    for (; row < lines.length; row++) {
      y += lines[row].height;
    }

    textHeight = y;

show(`first: ${firstVisibleRow}, last: ${lastVisibleRow}, textH: ${textHeight}`);

    let attrs = {
      style: {
        fontFamily: this.fontFamily,
        fontSize: this.fontSize + "px",
        color: this.fontColor,
      }
    };

    return h("div.newtext.newtext-scroller",
             {
               scrollLeft, scrollTop,
               onscroll: evt => {
                 let dirty = this._dirty;
                 let {scrollLeft, scrollTop} = evt.target;
                 this.setProperty("textScroll", pt(scrollLeft, scrollTop));
                 this._dirty = dirty;

               }
             },
             h("div.newtext.newtext-wrap", attrs,
               lines.map(ea =>
                 h("div.line", h("span", ea.text || h("br"))))));
  }

  render(renderer) {
    function AfterTextRenderHook() {}
    AfterTextRenderHook.prototype.hook = (node, propName, prevValue) => {
      // inspect({node, propName, prevValue})
      // let {scrollLeft, scrollTop} = node.querySelector(".newtext-scroller");
      // show(""+scrollLeft +scrollTop)
      // let dirty = this._dirty;
      // this.setProperty("textScroll", pt(scrollLeft, scrollTop));
      // this._dirty = dirty;
    }

    return h("div", {
      ...defaultAttributes(this, renderer),
      style: defaultStyle(this),
      "after-text-render-hook": new AfterTextRenderHook()
    }, [
      renderer.renderSubmorphs(this), this.renderTextStuff(renderer)]);
  }

  actualLineHeights(morphNode) {
    // this.actualLineHeights(this.env.renderer.getNodeForMorph(this))
    let spans = morphNode.querySelectorAll(".newtext .line");
    return Array.from(spans).map(ea => ea.getBoundingClientRect().height);
  }

  estimateLineHeights(lines) {
    // this.reset()
    // this.estimateLineHeights(this.lineData.lines);
    // 
    // let chars = arr.range(64, 125).map(ea => String.fromCharCode(ea))
    // while(chars.length < 300) chars.push(...chars)
    // let lines = arr.range(0, 1000).map(_ => ({height: 0, text: arr.shuffle(chars).slice(0, num.random(0, 300)).join("")}))
    // lines.forEach(ea => ea.height=0)
    // this.estimateLineHeights(lines);
    // let t = Date.now(); this.estimateLineHeights(lines); Date.now()-t;
    // this.content = lines.map(ea => ea.text).join("\n")

    // arr.pluck(this.lineData.lines, "height")

    let measure = DOMTextMeasure.initDefault().reset(),
        defaultStyle = obj.select(this, ["fontFamily", "fontSize", "fontWeight", "fontStyle", "textDecoration", "textStyleClasses"]),
        {width: textWidth, height: textHeight} = this,
        wraps = true;

    for (let i = 0; i < lines.length; i++) {
      let line = lines[i];
      if (line.height > 0) continue;
      let props = line.props,
          styles = [];

      // find all styles that apply to line
      if (!props) styles.push(defaultStyle);
      else for (let j = 0; j < props.length; j++)
        styles.push({...defaultStyle, ...props[j]});

      // measure default char widths and heights
      let charWidthN = 0, charWidthSum = 0, charHeight = 0;
      for (let h = 0; h < styles.length; h++) {
        let {width, height} = measure.defaultCharExtent(styles[h]);
        charHeight = Math.max(height, charHeight);
        if (wraps) { charWidthSum += width; charWidthN++; }
      }

      let estimatedHeight = charHeight;
      if (wraps) {
        let charWidth = (charWidthSum/charWidthN),
            charsPerline = Math.max(3, textWidth / charWidth);
        estimatedHeight = (Math.ceil(line.text.length / charsPerline) || 1) * charHeight;
      }
      line.changeHeight(estimatedHeight);
    }

    return arr.pluck(lines, "height")
  }

  onMouseMove(evt) {
    show(evt.position);
  }
}

